INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (0, 119901, "2023/12/27 11:59:59", 14, 0, 0, 0, "ミヤコ（クリスマス）", "みやこ", 1, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 2.17, 302, 1, 1, 450, 0, 119901, 1, 0, 3, "2023/12/22 12:00:00", 119901, 119901);
